  }
  return (
    <div>
      <Form onSubmit={handleSubmit}>
        <Form.Group controlId="formBasicEmail">
          <Form.Control
            onChange = {(e) => useEmail(e.target.value)}
            className="mb-3"
            placeholder="email address"
            type="email"
          />
        </Form.Group>

